CREATE  EVENT `event_move_expired_tokens` ON SCHEDULE EVERY 24 HOUR STARTS '2017-07-28 02:00:00' ON COMPLETION PRESERVE ENABLE COMMENT 'Moves expired tokens to history' DO BEGIN

	DECLARE temp_defualt_expire_miutes INT;
	set temp_defualt_expire_miutes =xfusion_config_getvalue('DefaultTokenExpirationMinutes');
	
		`user_id`,
		`application_id`,
		`access_key`,
		`token`,
		`added_on`,
		`is_mobile_token`
	)
	SELECT
		`user_id`,
		`application_id`,
		`access_key`,
		`token`,
		`added_on`,
		`is_mobile_token`
	FROM auth_token 
	where is_mobile_token=0 and TIMESTAMPDIFF(MINUTE,from_unixtime(added_on),now()) >temp_defualt_expire_miutes;
	 
	DELETE FROM  auth_token 
	where is_mobile_token=0 and TIMESTAMPDIFF(MINUTE,from_unixtime(added_on),now()) >temp_defualt_expire_miutes;

END//
DELIMITER ;

