IN in_user_key varchar(255), 
IN in_user_id VARCHAR(255), 
IN in_edit_user_id INT,
IN in_edit_role_id INT
)
    COMMENT 'This Procedure helps to add a user in a particular application.'
BEGIN

/*
	--------------------------------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to add a user in a particular application.
	Created On	:	
	Created By	:	Shantanu Bansal
  Modified By : Sarang Sapre
  Modified On : 26 Sept 2018
  Modification : Applied Localization
	--------------------------------------------------------------------------------------------------------------------------------------
	Inputs	:   in_user_key 			------------	(User's Key)								------------------------ VARCHAR (255),
				in_user_id  			------------	(User's ID)									------------------------ VARCHAR (255),
				in_edit_user_id			------------	(User's Id to Add)							------------------------ INT,
				in_edit_role_id			------------	(Roles's ID to add with)					------------------------ INT

	Output	:	Updates and Sends a message with a code
	---------------------------------------------------------------------------------------------------------------------------------------
*/





  -- Variables
  DECLARE temp_application_id INT;
  DECLARE catchArbitrary BOOLEAN;
  DECLARE in_lang_code INT ;
  DECLARE temp_default_lang_code INT;
  DECLARE temp_lang_code INT ;
  
  
  
  SET in_lang_code=null;
  SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
  SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));

  
  -- Get Application ID FROM ROLE
  SET temp_application_id      = (SELECT application_id
                                  FROM   roles
                                  WHERE  id = in_edit_role_id);

  IF(SELECT COUNT(*) FROM vw_users_roles_applications WHERE applications_id= temp_application_id and users_user_key=in_user_key) THEN
		-- COMES IN THE CONDITIONAL LOOP IF USER IS IN THE APPLICATION
        -- DELETE PREVIOUS ROLE IF EXISTS IN THE APPLICATION BECAUSE USER CAN BE ONLY IN ONE ROLE PER APPLICATION
	  DELETE FROM user_roles
	  WHERE       role_id IN (SELECT id
							  FROM   roles
							  WHERE  application_id = temp_application_id) AND user_id = in_edit_user_id;
	
		-- INSERT THE NEW ROLE OF THE USER
	  VALUES      (in_edit_user_id, in_edit_role_id);
	  SET catchArbitrary=(SELECT xfusion_message_getsingle("isUserAdded",TRUE,temp_lang_code)); 								-- Get Message From messages table
	  SELECT @code as code,@msg as msg;  
	  
  ELSE
				SET catchArbitrary=(SELECT xfusion_message_getsingle("isUserApplicationValid",FALSE,temp_lang_code)); 			-- Get Message From messages table
				SELECT @code as code,@msg as msg;  
  
  END IF;
  
  
END//
DELIMITER ;

