-- Dumping structure for procedure xfusion_auth_engine.xfusion_auth_session_check
DROP PROCEDURE IF EXISTS `xfusion_auth_session_check`;
DELIMITER //
CREATE  PROCEDURE `xfusion_auth_session_check`(IN `in_user_key` VARCHAR(255), IN `in_user_id` VARCHAR(255), IN `in_application_key` VARCHAR(255), IN `in_token` VARCHAR(255)
)
    COMMENT 'Helps to maintain the session'
BEGIN

	/*
    ----------------------------------------------------------------------------------------------------------------
  	  Description	:   Helps to maintain the user session.
  	  Created On	:	  2017-06-09
  	  Created By	:	  Abhishek Ginani
  	  ----------------------------------------------------------------------------------------------------------------
  	  Inputs		:   	in_user_id- Name of the user 
  					      in_user_key- User Key
  					      in_token - application token
							in_application_key : Application ID
			  					
      Output		:	is_session_manage: 1 - if session is enabled else 0
							is_single_sign_on_manage: 1 - if single sign on is enabled else 0
							is_password_expire_manage: 1 - if password expire is enabled else 0

      -----------------------------------------------------------------------------------------------------------------
  */

	DECLARE temp_organization_id INT;
    DECLARE temp_session_count INT;

	DECLARE is_session_manage TINYINT;
	DECLARE is_session_active TINYINT;
    DECLARE is_another_user_active TINYINT;
    DECLARE is_create_session TINYINT;

	DECLARE is_single_sign_on_manage TINYINT;
	DECLARE is_single_sign_on_active TINYINT;

	DECLARE is_password_expire_manage TINYINT;
	DECLARE is_password_expired TINYINT;

	DECLARE temp_password_expire_time INT;
	DECLARE temp_session_expire_time INT;

	DECLARE temp_password_expiration_time DATETIME;
	DECLARE temp_session_expiration_time DATETIME;

	DECLARE time_now DATETIME;
	DECLARE temp_user_id int;
	DECLARE temp_last_password_changed_date DATETIME;
	
	-- Get user session settings 
	SET temp_user_id=(select id from users where user_key=in_user_key limit 1);
	SET temp_last_password_changed_date=(select last_password_changed_date from membership where user_id=temp_user_id limit 1);
 --   SET temp_application_id=(select id from applications where application_key=in_application_key); 
   
	SET time_now=(SELECT UTC_TIMESTAMP());

	SET is_session_manage=(SELECT is_session_enable FROM auth_session_config WHERE user_id=temp_user_id limit 1);
	
					
	SELECT 
		is_single_sign_on_enable,
		is_password_expire,
		password_expire_time,
		session_expire_time
	INTO
		is_single_sign_on_manage,
		is_password_expire_manage,
		temp_password_expire_time,
		temp_session_expire_time
	FROM auth_session_config 
	WHERE user_id=temp_user_id;
	

    
   SET is_another_user_active=FALSE;
	-- Check whether session and password expire is enabled or not
	IF(is_session_manage=0 AND is_single_sign_on_manage=0 AND is_password_expire_manage=0) THEN
			set @allow_login=TRUE;
			SELECT 1,is_session_manage,is_single_sign_on_manage,is_password_expire_manage,0 as is_valid,@allow_login as allow_login;

    ELSE
			IF( is_password_expire_manage=1) 
			THEN
				-- Password Manage ON			
				SET temp_password_expiration_time=(SELECT DATE_ADD(temp_last_password_changed_date,INTERVAL temp_password_expire_time DAY));
				SET is_password_expired=(SELECT IF(temp_password_expiration_time>time_now,FALSE,TRUE));
				-- SELECT temp_password_expiration_time,time_now;
				-- SELECT is_session_manage;
				IF(is_password_expired=0) THEN
					-- Password Not Expired      
					IF(is_session_manage=1) THEN 
							
							-- Session mananged
							SET temp_session_expiration_time=(SELECT DATE_ADD(last_activity_time,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);
							-- SELECT temp_session_expiration_time;
							SET temp_session_count=(	
																SELECT 
																	count(distinct session_key) 
																FROM auth_sessions 
																WHERE user_key=in_user_key 
															);
					
						IF temp_session_expiration_time is null THEN 
								IF (is_single_sign_on_manage=1) THEN
											-- Check Session Key
											IF temp_session_count>=1 
											THEN
												SET is_another_user_active=TRUE;
												SET @allow_login=FALSE;
												SET is_create_session=1;
                                    SET is_session_active=0;
                                    
												SELECT 2,is_session_active,is_create_session,@allow_login as allow_login,is_another_user_active,
												is_single_sign_on_manage,
												is_password_expire_manage,
												is_password_expired,
												temp_password_expiration_time as password_expire_time,
												is_session_manage,@temp_session_expiration_time2 as session_expire_time;   
											ELSE 
												
												-- InSERT SESSION HERE
												SET is_another_user_active=FALSE;
												SET is_create_session=0;
                                    SET is_session_active=1;
											-- 	UPDATE sessions
											-- 			SET last_activity_time=time_now
											-- 			WHERE session=in_token;
												SET @allow_login=TRUE;
																						user_id,user_key,application_key,
																						created,is_logged_in,session_key,
																						last_activity_time
																					 )
													values( in_user_id,in_user_key,in_application_key,
															  time_now,1,
															  in_token,time_now
															); 
												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);   
												 
												SELECT 3,is_session_active,
												is_create_session,@allow_login as allow_login,
												is_another_user_active,is_single_sign_on_manage,
												is_password_expire_manage,is_password_expired,
												temp_password_expiration_time as password_expire_time,
												is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											END IF;
											
								else
								
									-- INSERT SESSION
												SET is_create_session=1;

												SET @allow_login=TRUE;
                                                  SET is_session_active=1;
													values(in_user_id,in_user_key,in_application_key,time_now,1,in_token,time_now); 
												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);   
												-- 	insert into sessions(organization_id,user_id,user_key,application_key,created,is_logged_in,session_key,last_activity_time)
												-- 	values(temp_organization_id,in_user_id,in_user_key,in_application_key,time_now,1,in_token,time_now); 
												SELECT 4,is_session_active,is_create_session,@allow_login as allow_login,
												is_single_sign_on_manage,is_password_expire_manage,
												is_password_expired,temp_password_expiration_time as password_expire_time,
												is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											
								
								END IF;
							
							
								ELSE 
								IF temp_session_expiration_time>time_now THEN
								 -- session still active
										-- active session
									 
									 IF (is_single_sign_on_manage=1) THEN
											-- Check Session Key
											IF temp_session_count>=1 THEN
												SET is_create_session=1;
													SET is_another_user_active=TRUE;
													SET @allow_login=FALSE;
	                                     SET is_session_active=1;
												SELECT 5,is_session_active,is_create_session,is_another_user_active,
												@allow_login as allow_login,is_single_sign_on_manage,
												is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,
												is_session_manage,@temp_session_expiration_time2 as session_expire_time;   
											ELSE 
												
												-- Update SESSION HERE
												SET is_create_session=0;
												UPDATE auth_sessions
													SET last_activity_time=time_now
													WHERE session_key=in_token;
												SET @allow_login=TRUE;
                                                SET is_session_active=1;
												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM sessions WHERE session_key=in_token);   
												-- 	insert into sessions(organization_id,user_id,user_key,application_key,created,is_logged_in,session_key,last_activity_time)
												-- 	values(temp_organization_id,in_user_id,in_user_key,in_application_key,time_now,1,in_token,time_now); 
												SELECT 6,is_session_active,is_create_session,is_another_user_active,
												@allow_login as allow_login,is_single_sign_on_manage,is_password_expire_manage,
												is_password_expired,temp_password_expiration_time as password_expire_time,
												is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											END IF;
											
									else
								
									-- INSERT SESSION
									 SET is_create_session=0;
											-- 	UPDATE sessions
											-- 			SET last_activity_time=time_now
											-- 			WHERE session=in_token;
												SET @allow_login=TRUE;
                                                SET is_session_active=1;
												UPDATE auth_sessions
													SET last_activity_time=time_now
													WHERE session_key=in_token;
												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);   
												-- 	insert into sessions(organization_id,user_id,user_key,application_key,created,is_logged_in,session_key,last_activity_time)
												-- 	values(temp_organization_id,in_user_id,in_user_key,in_application_key,time_now,1,in_token,time_now); 
												SELECT 7,is_session_active,is_create_session,@allow_login as allow_login,is_single_sign_on_manage,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											
								
									END IF;					 										
										
									ELSE
										-- session expired
                             		IF temp_session_count>1 THEN
												SET is_create_session=1;
	                                            SET is_session_active=0;
													SET is_another_user_active=TRUE;
													SET @allow_login=FALSE;
												SELECT 8,is_session_active,is_create_session,is_another_user_active,@allow_login as allow_login,is_single_sign_on_manage,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage,@temp_session_expiration_time2 as session_expire_time;   
											ELSE 

												SET @allow_login=FALSE;
                                                SET is_create_session=1;
                                                SET is_session_active=0;
												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);   
												-- 	insert into sessions(organization_id,user_id,user_key,application_key,created,is_logged_in,session_key,last_activity_time)
												-- 	values(temp_organization_id,in_user_id,in_user_key,in_application_key,time_now,1,in_token,time_now); 
												SELECT 9,is_session_active,is_create_session,is_another_user_active,@allow_login as allow_login,is_single_sign_on_manage,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											END IF;
                                        
                                        
                    								END IF;
						END IF;    
					ELSE
						SET @allow_login=TRUE; 
						SET is_create_session=0;
                        SET is_session_active=0;
						SELECT 10,is_session_active,is_single_sign_on_manage,is_create_session,@allow_login as allow_login,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage;
					-- Session Not Managed
					END IF;
				ELSE
					-- 	PASSOWOD EXPIRED
					SET @allow_login=FALSE;SET is_create_session=1;
					SELECT 11,is_single_sign_on_manage,is_create_session,@allow_login as allow_login,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage;
				
				END IF;
			ELSE
				
				-- Password Manage OFF
					IF(is_session_manage=1) THEN 
					-- Session mananged
							SET temp_session_expiration_time=(SELECT DATE_ADD(last_activity_time,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token limit 1);
							-- SELECT temp_session_expiration_time;
								SET temp_session_count=(	
																SELECT 
																	count(distinct session_key) 
																FROM auth_sessions 
																WHERE user_key=in_user_key 
															);
							
						
						IF temp_session_expiration_time is null THEN 
								IF (is_single_sign_on_manage=1) THEN
											-- Check Session Key
											IF temp_session_count>=1 THEN
												SET is_another_user_active=TRUE;
												SET @allow_login=FALSE;
												SET is_create_session=1;
                                                SET is_session_active=0;
											SELECT 12,is_session_active,is_create_session,@allow_login as allow_login,is_another_user_active,is_single_sign_on_manage,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage,@temp_session_expiration_time2 as session_expire_time;   
