												SET @temp_session_expiration_time3=(SELECT DATE_ADD(time_now,INTERVAL temp_session_expire_time MINUTE) FROM auth_sessions WHERE session_key=in_token);   
												 
												SELECT 13,is_session_active,is_create_session,@allow_login as allow_login,is_another_user_active,is_single_sign_on_manage,is_password_expire_manage,is_password_expired,temp_password_expiration_time as password_expire_time,is_session_manage,@temp_session_expiration_time3 as session_expire_time;
											END IF;
											
								else
								
									-- INSERT SESSION
									 SET is_create_session=1;

												SET @allow_login=TRUE;
                                                  SET is_session_active=1;
