-- Dumping structure for procedure xfusion_auth_engine.xfusion_auth_session_update
DROP PROCEDURE IF EXISTS `xfusion_auth_session_update`;
DELIMITER //
CREATE  PROCEDURE `xfusion_auth_session_update`(IN `in_delete_previous_session` INT, IN `in_create_new_session` INT, IN `in_user_key` VARCHAR(255), IN `in_user_id` VARCHAR(255), IN `in_application_key` VARCHAR(255), IN `in_token` VARCHAR(255))
    COMMENT 'This Procedure helps to update the session'
BEGIN
	/*
    ----------------------------------------------------------------------------------------------------------------
	Description	:   This Procedure helps to update the user session.
	Created On	:	23-06-2016
	Created By	:	Shantanu Bansal
	----------------------------------------------------------------------------------------------------------------
	Inputs		:  in_delete_previous_session  	: Option to delete previous session. If 1 delete previous session of user
						in_create_new_session 			: Option to create new session. If 1 create new session of user
                  in_user_key							: User key of user whose session need to be updated  
						in_user_id							: Email ID of User
						in_application_key				: Application in user currently logged-In.
						in_session_key						: Current session key associated with user
                  in_last_activity_date 			: Date Time of user's Last activity                  
                  in_last_password_change_date  : Date Time of user's last password change
    Output		: 
    -----------------------------------------------------------------------------------------------------------------
	*/	
	
DECLARE temp_user_id int;
DECLARE temp_tokens text;
SET SESSION group_concat_max_len = 18446744073709551615;


SET temp_user_id=(select id from users where user_key=in_user_key);

-- delete user session 
IF (in_delete_previous_session) then
				
	-- Create new user session
	if(in_create_new_session) THEN
		
			      
	SET temp_tokens=(	SELECT group_concat(token) as token
		FROM auth_token 
		WHERE user_id=temp_user_id and token!=in_token and is_mobile_token=0
		); 
		
		DELETE FROM auth_sessions WHERE user_key=in_user_key and session_key!=in_token;
		DELETE FROM auth_token WHERE user_id=temp_user_id and token!=in_token and is_mobile_token=0;
	
		
		`user_id`,
		`user_key`,
		`application_key`,
		`created`,

		`is_logged_in`,
		`session_key`,
		`last_activity_time`)
		VALUES
		(
		in_user_id,in_user_key,in_application_key,UTC_TIMESTAMP(),1,in_token,UTC_TIMESTAMP()
		);
		
		SELECT 'All other user logged off! and You are logged in' as msg,
		  		1 as 'is_all_other_logged_out',1 as 'is_session_active',
		  		temp_tokens as token; 

	else
		SET temp_tokens=(	SELECT group_concat(token) as token
		FROM auth_token 
		WHERE user_id=temp_user_id and is_mobile_token=0
		); 
		
		DELETE FROM auth_sessions WHERE user_key=in_user_key and session_key!=in_token;
		DELETE FROM auth_token WHERE user_id=temp_user_id and token!=in_token and is_mobile_token=0;
		select temp_tokens as token;
	END IF;

	
else

	if(in_create_new_session) THEN


		`user_id`,
		`user_key`,
		`application_key`,
		`created`,

		`is_logged_in`,
		`session_key`,
		`last_activity_time`)
		VALUES
		(
		in_user_id,in_user_key,in_application_key,UTC_TIMESTAMP(),1,in_token,UTC_TIMESTAMP()
		);
         SELECT 'You are logged in' as msg,0 as 'is_all_other_logged_out',1 as 'is_session_active';
	else
		UPDATE auth_sessions
		SET last_activity_time=UTC_TIMESTAMP()  WHERE session_key=in_token;


	END IF;




END IF;




END//
DELIMITER ;

