CREATE  PROCEDURE `xfusion_auth_validate_token`(IN `in_user_key` varchar(56), IN `in_user_id` varchar(56), IN `in_token` varchar(56), IN `in_application_key` varchar(56), IN `in_token_type` tinyint
)
BEGIN
	
	/*
      ----------------------------------------------------------------------------------------------------------------
  	  Description	:   Verifies that the specified token is valid or not 
  	  Created On	:	  2016-06-09
  	  Created By	:	  Abhishek Ginani
  	  ----------------------------------------------------------------------------------------------------------------
  	  Inputs		:   	in_user_id- Name of the user to validate.
  					      in_user_key- User Key
  					      
							in_token_type		 : 	0 - for Web users
															1- for mobile users
														
							in_application_key : Application ID
			  					
      Output		:	
      -----------------------------------------------------------------------------------------------------------------
  */
		declare temp_user_id int;
		declare temp_application_id int;
		declare temp_access_key varchar(56);
		declare temp_role_id int;
		declare temp_role_name varchar(56);
		declare temp_is_change_password_prompt_enable INT ;
    
		-- Get User ID, application id and associated access key
 
		set temp_user_id=(select id from users where user_key=in_user_key limit 1);
    set temp_is_change_password_prompt_enable=(SELECT is_change_password_prompt_enable FROM membership where user_id=temp_user_id);
		set temp_application_id=(select id from applications where application_key=in_application_key limit 1);
		set temp_access_key=(
									select roles_access_key
									from vw_users_roles_applications 
									where users_id=temp_user_id and application_key=in_application_key limit 1
		
									);
									
		-- Get role information									
		SELECT id,
  				 alias 
		INTO temp_role_id,temp_role_name
		FROM  roles 
		WHERE access_key=temp_access_key;
		
		-- check if token is exist in table or not
		IF(	select count(*) as is_valid 
				from auth_token 
				where
				token= in_token
			)>0
		THEN	
			
			-- If token exists, look for the application associated with it		
			IF (	
					select count(*) as is_valid 
					from auth_token 
					where user_id=temp_user_id and 
					token= in_token and 
					application_id=temp_application_id
					
				)>0 THEN
				
		
					-- If token is there, then true as status and other user info associated with token				
				  select temp_role_name as roles_name,
						 	temp_role_id as roles_id,
							true as status, 
							in_user_key as user_key, 
							in_user_id as user_id ,
							temp_access_key as access_key,
							utc_timestamp() as `utc_time`,
							in_token as access_token,
              temp_is_change_password_prompt_enable as change_password_popup;       
						
			ELSE
					-- If token application mapping is not available then check if user has permission on requested application or not?
					IF (temp_access_key is not null)
					THEN
							
							-- If user access has access to requested app, then return true and other user info with access details
								-- Insert Token on successfull login
								set @access_token:=NULL;
								set @access_token:=in_token; -- uuid();
								user_id,	application_id,	access_key,
								token,	added_on,is_mobile_token
								)
								values(
									temp_user_id,temp_application_id,temp_access_key,
									@access_token,unix_timestamp(),	in_token_type
								);
								
							select temp_role_name as roles_name,
						 	temp_role_id as roles_id,
							true as status, 
							in_user_key as user_key, 
							in_user_id as user_id ,
							temp_access_key as access_key,
							utc_timestamp() as `utc_time`,
							in_token as access_token,
               temp_is_change_password_prompt_enable as change_password_popup;   
	                           
					ELSE
							-- Return false if does not have permission to access this application
							select 
							false as status,
							temp_access_key,
							temp_application_id,
								1,
							utc_timestamp() as `utc_time`,
								in_user_key,
								in_user_id,temp_user_id,
								in_token;   
					END IF;
			END IF;	
		ELSE
					-- Return false if token not exists
					select 
					false as status, 
					temp_access_key,
					temp_application_id,
2,
					utc_timestamp() as `utc_time`;   
		END IF;	
			
			
			
		
END//
