-- Dumping structure for procedure xfusion_auth_engine.xfusion_device_topology_get_by_device_2
DROP PROCEDURE IF EXISTS `xfusion_device_topology_get_by_device_2`;
DELIMITER //
CREATE  PROCEDURE `xfusion_device_topology_get_by_device_2`(	
	in in_user_key varchar(56),
    in in_user_id varchar(56),
	in in_organization_id int,
    in in_device_id int
)
BEGIN
	
    DECLARE temp_continue TINYINT;
    DECLARE temp_devices varchar(256);
    
    SET temp_continue=1;
    
    -- Get all accessible devices
    CALL xfusion_utility_device_get_all(in_user_key,in_user_id,0);
    
    -- Check if user has access to device or not
    IF  (SELECT COUNT(1) FROM temp_device_type_id where device_device_device_id in (in_device_id))>0    
    THEN
    
		DROP TEMPORARY TABLE IF EXISTS temp_topology;
		CREATE TEMPORARY TABLE temp_topology
		SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge
		FROM device_devicetopology
		WHERE organization_id=in_organization_id and origid=in_device_id;
		
		SET temp_devices=(SELECT GROUP_CONCAT(destid) FROM temp_topology);

		-- Scan devices source to destination	
		DROP TEMPORARY TABLE IF EXISTS temp_scanned_devices;
		CREATE TEMPORARY TABLE temp_scanned_devices
		SELECT distinct origid FROM temp_topology;
		

		WHILE temp_continue
		DO
			-- Get topology
			DROP TEMPORARY TABLE IF EXISTS temp_device;
			CREATE TEMPORARY TABLE temp_device
			SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge	
			FROM device_devicetopology
			WHERE organization_id=in_organization_id and (destid) in (SELECT device_device_device_id FROM temp_device_type_id)
            and
			find_in_set(origid,temp_devices) and origid not in  (select origid from temp_scanned_devices);
			
			SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge 
			FROM temp_device ;
			
			CALL xfusion_utilities_string_split(temp_devices);
			
			-- Update scanned device table
			SELECT split_data FROM temp_convert;
			
			IF(SELECT COUNT(*) FROM temp_device)>0
			THEN
				SET temp_devices=(SELECT GROUP_CONCAT(destid) FROM temp_device);
			ELSE
				SET temp_continue=FALSE;
			END IF;		
				
		END WHILE;
        
           -- Scan devices Destination to source
           
        -- Starting from destination    
        DROP TEMPORARY TABLE IF EXISTS temp_topology_dest;
		CREATE TEMPORARY TABLE temp_topology_dest
		SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge
		FROM device_devicetopology
		WHERE organization_id=in_organization_id and destid=in_device_id;
        
        
        SET temp_devices=(SELECT GROUP_CONCAT(origid) FROM temp_topology_dest);
        
     
		DROP TEMPORARY TABLE IF EXISTS temp_dest_scanned_devices;
		CREATE TEMPORARY TABLE temp_dest_scanned_devices
		SELECT distinct destid FROM temp_topology_dest;
		
        SET temp_continue=1;


		WHILE temp_continue
		DO
		
			-- Get topology
			DROP TEMPORARY TABLE IF EXISTS temp_device;
			CREATE TEMPORARY TABLE temp_device
			SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge	
			FROM device_devicetopology
			WHERE organization_id=in_organization_id  and origid in (SELECT device_device_device_id FROM temp_device_type_id) 
            and
			find_in_set(destid,temp_devices)  and destid not in  (select destid from temp_dest_scanned_devices);
			
            
   
			SELECT id,origid,destid,orig_x,orig_y,dest_x,dest_y,edge 
			FROM temp_device ;
			
			CALL xfusion_utilities_string_split(temp_devices);
			
			-- Update scanned device table
			SELECT split_data FROM temp_convert;
			
			IF(SELECT COUNT(*) FROM temp_device)>0
			THEN
				SET temp_devices=(SELECT GROUP_CONCAT(origid) FROM temp_device);
			ELSE
				SET temp_continue=FALSE;
			END IF;		
				
		END WHILE;
		SELECT *  FROM temp_topology
		UNION
		SELECT * FROM temp_topology_dest;

	ELSE
		SELECT 'No data available' as message;
    END IF;
    


  
END//
DELIMITER ;

-- Dumping structure for procedure xfusion_auth_engine.xfusion_exception_log_count
