DELIMITER //
CREATE  PROCEDURE `xfusion_exception_log_count`(
	IN `in_user_key` VARCHAR(255),
	IN `in_user_id` VARCHAR(255),
	IN `in_application_key` VARCHAR(255),
	IN `in_from_date` INT,
	IN `in_end_date` INT,
	IN `in_condition` VARCHAR(1024)
)
    COMMENT ' This Procedure helps to get the count of exception logs'
BEGIN

 /*
	--------------------------------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to get the count of exception logs
	Created On	:	
	Created By	:	Amit Agarwal
	--------------------------------------------------------------------------------------------------------------------------------------
	Inputs :	in_user_key 			------------	(User's Key)								
				    in_user_id  			------------	(User's ID)								
				    in_application_key	------------	(Application Key )		
				    in_from_date			----------- From Date
			    	in_end_date				----------- End Date
            in_limit          ----------- Limit
            in_offset         ----------- Offset
				in_condition		----------- 		

	Output	:	 This Procedure helps to get the count of exception logs
	---------------------------------------------------------------------------------------------------------------------------------------
*/

	DROP TABLE IF EXISTS temp_log_exception_data;
	CREATE TEMPORARY TABLE temp_log_exception_data
	AS
		SELECT  log_exception.id AS log_exception_id,
			  log_exception.controller_url AS log_exception_controller_url,
	        log_exception.input_parameter   AS log_exception_input_parameter,
	        log_exception.output  AS   ip_address,
	        log_exception.exception    AS   log_exception_exception,
	        log_exception.user_id   AS   log_exception_user_id,
	        log_exception.userKey   AS   log_exception_userKey,
	        log_exception.application_id AS   log_exception_application_id,
	        log_exception.createdAT AS   log_exception_createdAT,
	        users.name AS users_name
	FROM log_exception 
	LEFT JOIN users ON log_exception.user_id=users.id   
	WHERE log_exception.userKey=in_user_key AND application_id=in_application_key AND createdAT BETWEEN (in_from_date) AND (in_end_date) 
	ORDER BY  log_exception.createdAT DESC;


	set in_condition=coalesce(in_condition,TRUE);
	set @sql_statement=concat_ws(""," select count(*) as `count` from temp_log_exception_data where ",in_condition);
	
	prepare stmt from @sql_statement;
	execute stmt;

END//
