CREATE  PROCEDURE `xfusion_otp_get_by_user`(
  IN in_user_name varchar(255),
  IN in_otp varchar(10)
)
    COMMENT ' This Procedure helps to get the one time password of a user'
BEGIN

 /*
	--------------------------------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to get the one time password of a user.
	Created On	:	 01-Febuary-2017
	Created By	:	 Amit Agarwal
	--------------------------------------------------------------------------------------------------------------------------------------
	Inputs :	in_user_key 			------------	(User's Key)								
				    in_user_id  			------------	(User's ID)								
				    in_user_name    	------------	(User Email ID)	
            in_otp            ------------  (User One Time Password)
				

	Output	:	 
	---------------------------------------------------------------------------------------------------------------------------------------
*/

  DECLARE temp_otp_duration int;
  DECLARE temp_otp varchar(10);
  
  SELECT otp,(TIMESTAMPDIFF(MINUTE,(creation_date + INTERVAL 330 MINUTE), (NOW()+ INTERVAL 330 MINUTE))) INTO temp_otp,temp_otp_duration FROM users_otp WHERE user_name=in_user_name;
  
  IF(temp_otp_duration>1)THEN
    SELECT 'OTP  Expired' as msg,0 as msgcode;
    DELETE FROM users_otp WHERE user_name=in_user_name;
  ELSE
     IF(SELECT COUNT(*) FROM users_otp WHERE user_name=in_user_name and otp=in_otp)>0 THEN
         SELECT 'OTP matches with the user name' as msg,1 as msgcode;
         DELETE FROM users_otp WHERE user_name=in_user_name;
     ELSE 
        SELECT 'OTP does not match with the user name' as msg,0 as msgcode;
     END IF;
   END IF;

   

END//
DELIMITER ;

