-- Dumping structure for procedure xfusion_auth_engine.xfusion_password_failure_update_count
DROP PROCEDURE IF EXISTS `xfusion_password_failure_update_count`;
DELIMITER //
CREATE  PROCEDURE `xfusion_password_failure_update_count`(in_user_key varchar(256))
    COMMENT ' Updates password failure count in membership for specified user.'
BEGIN
/*
    ----------------------------------------------------------------------------------------------------------------
	Description	:   Updates password failure count in membership for specified user.
	Created On	:	2016-06-09
	Created By	:	Abhishek Ginani
	----------------------------------------------------------------------------------------------------------------
	Inputs		:   in_user_key	------------------- User's Key	-------------------------------------- VARCAHR (256)					
					
    Output		:	Updates password failure count in membership for specified user.
    -----------------------------------------------------------------------------------------------------------------
*/
    -- Temporary variables
	declare temp_failed_password_attempt_count int;
    declare temp_failed_password_attempt_window_start datetime;
    declare temp_failed_password_attempt_window_end datetime;
    declare temp_max_invalid_password_attempts int;
    declare temp_password_attempts_window_in_minutes int;
    
    SET temp_failed_password_attempt_count=0;
    SET temp_failed_password_attempt_window_start=utc_timestamp();
    
    -- Temporary Tables
    drop temporary table if exists temp_membership;
    create temporary table temp_membership
	select  failed_password_attempt_count, 
			failed_password_attempt_window_start,
            user_id
	FROM vw_user_membership WHERE user_key=in_user_key ;
    
	-- Get current status of attempt count and attept windw start time
    select  failed_password_attempt_count, 
			failed_password_attempt_window_start INTO
            temp_failed_password_attempt_count,temp_failed_password_attempt_window_start
	FROM temp_membership limit 1;
    
	-- Get values from config
	SET temp_max_invalid_password_attempts=(select xfusion_config_getvalue('MaxInvalidPasswordAttempts'));
    SET temp_password_attempts_window_in_minutes=(select xfusion_config_getvalue('PasswordAttemptWindow'));
    SET temp_failed_password_attempt_window_end=date_add(temp_failed_password_attempt_window_start,interval 
														     temp_password_attempts_window_in_minutes MINUTE);
                                                             
    IF (temp_failed_password_attempt_count=0 OR utc_timestamp()>temp_failed_password_attempt_window_end) THEN
			UPDATE membership
				SET failed_password_attempt_count=1,
				failed_password_attempt_window_start=utc_timestamp()
			WHERE user_id in (select m.user_id from temp_membership m);
    ELSE 
		SET temp_failed_password_attempt_count=temp_failed_password_attempt_count+1;
        
        IF temp_failed_password_attempt_count>=temp_max_invalid_password_attempts THEN
				UPDATE membership
					SET is_locked_out=1,
						last_locked_out_date=utc_timestamp()
				WHERE user_id in (select m.user_id from temp_membership m);
		ELSE
			
            UPDATE membership
				SET failed_password_attempt_count= temp_failed_password_attempt_count
