    DECLARE temp_user_id varchar(255);
    

     
    DECLARE exit handler for sqlexception BEGIN ROLLBACK;END;
    
    SET in_lang_code=null;
    SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
    SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
    
    SET temp_pass=(SELECT xfusion_password_encode(in_newPassword,in_userkey));
      SET temp_user_id=(SELECT name FROM users where user_key=in_userkey);
    SET temp_pass_check_count=(SELECT password_check_count FROM membership WHERE email=temp_user_id);
  
    
    SET autocommit = 0;
    START TRANSACTION;
   
   /* 
    *Query will be on User_id
    */
    
    -- getting previous passwords
     DROP TEMPORARY TABLE IF EXISTS temp_users_password;
         CREATE TEMPORARY TABLE temp_users_password As 
         SELECT user_id,passwords 
         FROM user_passwords 
         WHERE user_key=in_userkey 
         ORDER BY id DESC 
         limit temp_pass_check_count;
    
    SET var_user_id = (SELECT id FROM users WHERE user_key=in_userkey LIMIT 1); 
    -- Check Existance of user in DB
    IF (!var_user_id) THEN 
		SET isUserExist = FALSE;
		SET catchAribitrary=(SELECT xfusion_message_getsingle('isUserExist',False,temp_lang_code)); 			-- Get Message From messages table
		SET is_valid=0;
        SELECT is_valid as status,@code as code,@msg as msg;
	
  ELSE IF ((SELECT COUNT(*) FROM temp_users_password WHERE passwords=temp_pass)!=0)THEN
