        SET getPassword = ( SELECT `password` FROM membership where user_id = var_user_id LIMIT 1);
       -- SELECT IF(getPassword=tmp_password,TRUE,FALSE);
       
       -- CHECKS WHETHER CURRENT PASSWORD MATCH WITH THE ENTERED PASSWORED 
        IF (tmp_password = getPassword) THEN 
