            -- CHECK WHETHER PASSWORD FORMAT IS VALID OR NOT
            IF (isPasswordValid = FALSE) THEN
				SET catchAribitrary=(SELECT xfusion_message_getsingle('isPasswordValid',False,temp_lang_code)); 			-- Get Message From messages table
				SET is_valid=0;
				SELECT is_valid as status,@code as code,@msg as msg;

