				SET catchAribitrary=(SELECT xfusion_message_getsingle('isPasswordUpdated',TRUE,temp_lang_code)); 			-- Get Message From messages table
				SET is_valid=1;
				SELECT is_valid as status,@code as code,@msg as msg;
        

