CREATE  FUNCTION `xfusion_password_validate`(in_password VARCHAR(255)) RETURNS tinyint(1)
BEGIN 
DECLARE is_valid BOOLEAN;
DECLARE min_length_of_password INT;
DECLARE max_length_of_password INT;
SET min_length_of_password = (SELECT xfusion_config_getvalue('MinLengthOfPassword'));
SET max_length_of_password = (SELECT xfusion_config_getvalue('MaxLengthOfPassword'));
SET is_valid = (SELECT  in_password REGEXP BINARY '[a-z]'
										AND in_password REGEXP BINARY '[A-Z]'
										AND in_password REGEXP BINARY '[0-9]'
										AND in_password REGEXP BINARY '^[a-zA-Z0-9]+$'
										AND CHAR_LENGTH(in_password) >= min_length_of_password
										AND CHAR_LENGTH(in_password) <= max_length_of_password
										LIKE '%@%' or '%!%' or '%#%' or '%$%' or '%\%%' or '%^%' 
                                        or '%&%' or '%*%' or '%(%' or '%)%' or '%_%' or '%-%' or 
                                        '%+%' or '%=%' or '%{%' or '%[%' or '%]%' or '%}%' or 
                                        '%|%' or '%\%' or '%:%' or '%;%' or '%"%' or '%\'%' or 
                                        '%,%' or '%<%' or '%>%' or '%.%' or '%?%' or '%/%' or '%~%'  or '%`%' 
);
RETURN is_valid;
END//
DELIMITER ;

