*/
	DECLARE is_valid BOOLEAN;
	DECLARE min_length_of_password INT;
	DECLARE max_length_of_password INT;
	SET min_length_of_password = (SELECT xfusion_config_getvalue('MinLengthOfPassword'));
	SET max_length_of_password = (SELECT xfusion_config_getvalue('MaxLengthOfPassword'));
	SET is_valid = (SELECT in_password REGEXP BINARY '[a-z]'
