-- Dumping structure for procedure xfusion_auth_engine.xfusion_session_manage
DROP PROCEDURE IF EXISTS `xfusion_session_manage`;
DELIMITER //
CREATE  PROCEDURE `xfusion_session_manage`(
 in in_session_id varchar(100) ,
 in in_applicaton_key varchar(56),
 in in_user_key varchar(56)
 )
    COMMENT 'Helps to maintain the session'
BEGIN
    /*
    
    Not using.
    Now session is managed at api level

    
    */
  DECLARE in_lang_code INT ;
  DECLARE temp_default_lang_code INT;
  DECLARE temp_lang_code INT ;
  
    
    DECLARE is_user_exists INT;
    DECLARE session_check INT;
	DECLARE session_timeout INT; -- in minutes
    DECLARE session_expires_on Datetime;
    DECLARE sessionid varchar(256);
    DECLARE userid int;
    DECLARE cur_timestamp datetime;
	DECLARE msg_parameter varchar(256);
	DECLARE parameter_value BOOLEAN;
    DECLARE status Tinyint;
    DECLARE application_id int;
  --  DECLARE exit handler for sqlexception BEGIN ROLLBACK;END;
    
   -- SET autocommit=0;
    
  --  START TRANSACTION;
    SET in_lang_code=null;
  SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
  SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
    SET application_id=(select id from applications where application_key=in_applicaton_key limit 1);
	SET is_user_exists=(select xfusion_user_check_existence(in_user_key));
    
    IF is_user_exists THEN
		SET userid=(select user_id from vw_user_membership usr where usr.user_key=in_user_key  limit 1);
		SET session_timeout=(select xfusion_config_getvalue('SessionTimeoutMinutes'));
		SET session_check=(select count(*) from sessions where application_id=application_id and user_id=userid);
		SET session_expires_on=(select expires from sessions where application_id=application_id and user_id=userid);
		SET sessionid=(select session_id from sessions where application_id=application_id and user_id=userid);
		SET cur_timestamp=utc_timestamp();
	
		if(session_check=0) THEN		
			values(in_session_id,application_id,userid,cur_timestamp,date_add(cur_timestamp,interval session_timeout minute));
			
			SET msg_parameter='newSession';
			SET parameter_value=1;
			SET status=1;
			
		elseif(session_check>0) and utc_timestamp()>session_expires_on THEN
			
			SET msg_parameter='sessionExpired';
			SET parameter_value=1;
			SET status=0;
			
		elseif(session_check>0) and utc_timestamp()<session_expires_on and sessionid=in_session_id THEN
			-- same user
		
			update sessions
				SET created=cur_timestamp,
				expires=date_add(cur_timestamp,interval session_timeout minute)
			where application_id=application_id and user_id=userid;
			
			SET msg_parameter='sessionIdMatched';
			SET parameter_value=1;
			SET status=1;
			
		elseif(session_check>0) and utc_timestamp()<session_expires_on and sessionid!=in_session_id THEN
			
  
			SET msg_parameter='sessionIdMatched';
			SET parameter_value=0;
			SET status=0;
			
		END IF;
			
	
	ELSE
		SET msg_parameter='isUserExist';
		SET parameter_value=0;
		SET status=0;
		
	END IF;
	SET @result= (select xfusion_message_getsingle(msg_parameter, parameter_value,temp_lang_code));
	-- COMMIT;  
	Select status,@code as code,@msg as message;
    
END//
DELIMITER ;

