CREATE  PROCEDURE `xfusion_string_split`(IN in_string text)
    COMMENT 'A xFuison Utility procedure. It helps to convert a C.S.V. into a single column table '
BEGIN
/*
	----------------------------------------------------------------------------------------------------------------
	Description	:  A xFuison Utility procedure. It helps to convert a C.S.V. into a single column table
	Created On	:	June 10,2016
	Created By	:	Shantanu Bansal
	----------------------------------------------------------------------------------------------------------------
	Inputs	:   Comma Sperated String
	Output	:	Each Comma Sperated value in the cell in a single column
	-----------------------------------------------------------------------------------------------------------------
*/
SET SESSION group_concat_max_len = 18446744073709551615;
	    -- Temporary table to hold splited row value of string
		   drop temporary table if exists temp_convert;
			create temporary table temp_convert(split_data text );
		   
		   -- dynamic query to break comma separated string as rows and insert into column
		   set @sql = (select group_concat(col SEPARATOR '') from (select "insert into temp_convert (split_data) values ('"	 as col
                  union all
                  select replace(( select group_concat(in_string) as converted_data), ",","'),('")
                  union all
                  select "' );"  
                  
                  ) p);


		
		prepare stmt1 from @sql;
		execute stmt1;
END//
DELIMITER ;

