CREATE  PROCEDURE `xfusion_theme_update`( IN `in_user_ids_list` TEXT, IN `in_theme_id` int(16),IN `in_app_logo` TEXT,IN `in_loading_icon` TEXT)
    COMMENT 'This Procedure helps to update theme of given users id list.'
BEGIN
   /*
  	--------------------------------------------------------------------------------------------------------------------------------------
  	Description	:  This Procedure helps to update theme of given users id list.
  	Created On	:	 25-October-2018
  	Created By	:	 Sarang Sapre
  	--------------------------------------------------------------------------------------------------------------------------------------
  	Inputs :	in_user_ids_list 			------------	comma sepreated list of user ids.							
  				    in_theme_id           ------------  Theme id to be updated.

  	Output	:	 return msg .
  	---------------------------------------------------------------------------------------------------------------------------------------
  */
--   1.Converted comma sepreated list of user ids into rows and insert in a temp table .
--   2.Then insert theme id in same table.
--   3.Bulk update theme acc o user ids .


    DECLARE catchAribitrary BOOLEAN; 
    DECLARE in_lang_code INT ;
    DECLARE temp_default_lang_code INT;
    DECLARE temp_lang_code INT ;
    SET in_lang_code=null;
    SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
    SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
    
    IF (in_theme_id IS NOT NULL OR in_app_logo IS NOT NULL OR in_loading_icon IS NOT NULL )THEN
    
          -- Converting comma seprated user ids into rows and inserting in temp table. 
          	 CALL xfusion_string_split(in_user_ids_list);
             DROP TABLE IF EXISTS temp_user_theme_details;
             CREATE TEMPORARY TABLE temp_user_theme_details(user_id varchar(255),theme_id int(11),app_logo TEXT,loading_icon TEXT);
             
             UPDATE temp_user_theme_details
             SET theme_id =in_theme_id ,
                 app_logo =in_app_logo,
                loading_icon =in_loading_icon
            WHERE app_logo IS NULL 
            AND loading_icon IS NULL 
            AND theme_id IS NULL;   
      

            UPDATE users
            INNER JOIN temp_user_theme_details 
            ON (users.name=temp_user_theme_details.user_id)
            SET users.theme_id =COALESCE(temp_user_theme_details.theme_id,users.theme_id),
                users.app_logo =COALESCE(temp_user_theme_details.app_logo,users.app_logo),
                users.loading_icon =COALESCE(temp_user_theme_details.loading_icon,users.loading_icon);
        
           SET @catchArbitrary=(SELECT xfusion_message_getsingle("isUpdated",TRUE,temp_lang_code));	-- Get Message From messages table
            SELECT  @msg AS msg;
            
     ELSE
          
          SET @catchArbitrary=(SELECT xfusion_message_getsingle("isFail",FALSE,temp_lang_code));	-- Get Message From messages table
            SELECT  @msg AS msg;

   END IF;
END//
DELIMITER ;

