CREATE  PROCEDURE `xfusion_users_logged_in`(IN `in_user_key` VARCHAR(56), IN `in_user_id` VARCHAR(56), IN `in_application_key` VARCHAR(56))
BEGIN

	declare temp_application_id int;
	set temp_application_id=(select id from applications where application_key=in_application_key limit 1);
	
	
	select sum(case when is_mobile_token=0 then 1 else 0 end) as web_users ,
			 sum(case when is_mobile_token=1 then 1 else 0 end) as mobile_users 
	from auth_token where application_id=temp_application_id;
END//
