		SET isAnonymous = FALSE; 														    	 	  -- Default for new User
		SET isDeleted = FALSE; 																   		  -- Default for new User
		
		IF (isPasswordValid = TRUE AND isUsernameValid = TRUE AND isPasswordQuestionValid = TRUE AND isPasswordAnswerValid = TRUE) THEN
			
