-- Dumping structure for procedure xfusion_auth_engine.xfusion_user_get_info_by_user_key
DROP PROCEDURE IF EXISTS `xfusion_user_get_info_by_user_key`;
DELIMITER //
CREATE  PROCEDURE `xfusion_user_get_info_by_user_key`(
	IN `in_user_key` VARCHAR(255),
	IN `in_application_key` VARCHAR(255)

)
    COMMENT 'Provides same detail as user get at the time of login'
BEGIN
/*

---------------------------------------------------------------------------------------------------
---------------------------------------------------------------------------------------------------
Description:	This Procedure helps to get the user's informaton based on his/her key
Created By:		Shantanu Bansal
---------------------------------------------------------------------------------------------------
Inputs:
						IN `in_user_key` VARCHAR(255),
						IN `in_application_key` VARCHAR(255)
						
Outputs:				Provides same detail as user get at the time of login
---------------------------------------------------------------------------------------------------
*/


-- Variables
		DECLARE temp_access_key VARCHAR(255);
		DECLARE temp_role_id INT;
		DECLARE temp_role_name VARCHAR(255);
		DECLARE temp_last_login_date DATETIME;
		DECLARE temp_last_activity_date DATETIME;
		DECLARE temp_password_change_date DATETIME;
		DECLARE temp_userid INT;
      DECLARE temp_user_email VARCHAR(255);

-- Get the Unique role key of user on the basis of its application
SET temp_access_key=
					(select roles_access_key 
						from vw_users_roles_applications
							where users_user_key=in_user_key and application_key=in_application_key limit 1);
							
-- Set role id and role name into the variable
SELECT id,alias 
					INTO temp_role_id,temp_role_name
																FROM  roles WHERE access_key=temp_access_key;
															
															
-- Initializr the required variables with proper value																
SET temp_userid=(SELECT id FROM users WHERE user_key=in_user_key);	
SET temp_user_email=(SELECT name FROM users WHERE user_key=in_user_key);																	
SET temp_last_login_date =(SELECT last_login_date FROM membership WHERE user_id=temp_userid);
SET temp_last_activity_date =(SELECT last_activity_date FROM membership WHERE user_id=temp_userid);
SET temp_password_change_date =(SELECT last_password_changed_date FROM membership WHERE user_id=temp_userid);
IF(SELECT count(*) FROM user_roles WHERE user_id=temp_userid AND role_id=temp_role_id) THEN
	UPDATE membership m, users u 
		SET m.last_login_date = UTC_TIMESTAMP(), u.last_activity_date = UTC_TIMESTAMP(),
				m.last_activity_date=UTC_TIMESTAMP() 
									WHERE m.user_id=temp_userid AND u.id=temp_userid;																
																
	select 
		temp_role_name as roles_name,
		temp_role_id as roles_id,
		in_user_key as user_key,
		temp_access_key as access_key,
			temp_user_email as user_id ,
		utc_timestamp() as `utc_time`,
		temp_last_activity_date as last_activity_date,
		temp_password_change_date as last_password_change_date,
		temp_last_login_date as last_login_date,
        1 as is_valid,
        'User exists in application' as message
        
		
		;
ELSE
	select 
	
		temp_user_email as user_id ,
		utc_timestamp() as `utc_time`,
		temp_last_activity_date as last_activity_date,
		temp_password_change_date as last_password_change_date,
		temp_last_login_date as last_login_date,
        0 as is_valid,
        'User does not exist in application' as message
        
		
		;


END IF;
END//
DELIMITER ;

