CREATE  PROCEDURE `xfusion_user_update_attribute`(
	IN `in_user_key` VARCHAR(255),
	IN `in_user_id` VARCHAR(255),
	IN `in_member_user_key` VARCHAR(255),
	IN `in_member_user_id` VARCHAR(255),
	IN `in_role_id` INT,
	IN `in_attribute_id` INT,
	IN `in_attribute_value` VARCHAR(255)



)
    COMMENT 'This Procedure helps to update the attribute value for the user'
BEGIN

/*
	----------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to update the attribute value for the user

	Created By	:	Shantanu Bansal
	----------------------------------------------------------------------------------------------------------------
	Inputs	:   
	----->> User Details
							IN `in_user_key` VARCHAR(255),
							IN `in_user_id` VARCHAR(255),
	----->> Details of user for whom values are going to be changed						
							IN `in_member_user_key` VARCHAR(255),
							IN `in_member_user_id` VARCHAR(255),
	----->> Role whose attribute is gonna change
							IN `in_role_id` INT,
	----->> Attribute and its value which is going to be affected
							IN `in_attribute_id` INT,
							IN `in_attribute_value` VARCHAR(255)
 
	Output	:	This Procedure helps to update the attribute value for the user
	-----------------------------------------------------------------------------------------------------------------
*/

-- Variables
	DECLARE temp_member_user_id int;
	DECLARE temp_attribute_alias VARCHAR(255);


-- If attribute is present then update
-- else add the attrribute
	IF(SELECT COUNT(*) FROM user_attribute
			WHERE user_key=in_member_user_key AND attribute_id=in_attribute_id)
	THEN

			UPDATE user_attribute 
			SET `value`=in_attribute_value
			WHERE user_key=in_member_user_key AND attribute_id=in_attribute_id;

	ELSE
			SET temp_member_user_id = (SELECT id FROM users WHERE user_key=in_member_user_key LIMIT 1);
			SET temp_attribute_alias = (SELECT alias FROM attributes WHERE id=in_attribute_id);
			`user_id`,
			`user_key`,
			`attribute_id`,
			`attribute_alias`,
			`value`)
			VALUES
			(
			temp_member_user_id,
			in_member_user_key,
			in_attribute_id,
			temp_attribute_alias,
			in_attribute_value
);


	END IF;

	IF(in_attribute_value!='') THEN

			SELECT 'Attribute updated' as msg, 1 as is_updated;


	ELSE
			SELECT 'Attribute deleted' as msg, 1 as is_updated;

	END IF;

END//
DELIMITER ;

