CREATE  PROCEDURE `xfusion_view_update`(
IN in_user_key VARCHAR(255),
IN in_user_id VARCHAR(255),
IN in_view_id INT,
IN in_view_name VARCHAR(255),
IN in_url VARCHAR(255)
)
    COMMENT 'This Procedure helps to update all the View.'
BEGIN


/*
	-----------------------------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to update all the View.
	Created On	:	
	Created By	:	Shantanu Bansal
	-----------------------------------------------------------------------------------------------------------------------------------
	Inputs	:   in_user_key 		------------	(User's Key)								------------------------ VARCHAR (255),
				in_user_id  		------------	(User's ID)									------------------------ VARCHAR (255),
				in_view_id			------------	(View's ID to Update )						------------------------ INT
				in_view_name  		------------	(View's Name)								------------------------ VARCHAR (255),
				in_url       		------------	(View's URL)									------------------------ VARCHAR (255),
	Output	:	
	------------------------------------------------------------------------------------------------------------------------------------
*/


  DECLARE in_lang_code INT ;
  DECLARE temp_default_lang_code INT;
  DECLARE temp_lang_code INT ;
	DECLARE temp_lowered_url VARCHAR(255);
	DECLARE catchArbitrary BOOLEAN;

		SET in_lang_code=null;
    SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
    SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
    SET temp_lowered_url = (SELECT LOWER(in_url));
		UPDATE views SET name=in_view_name, url=in_url, lowered_url=temp_lowered_url WHERE view_id = in_view_id;

		SET catchArbitrary=(SELECT xfusion_message_getsingle("isViewUpdated",TRUE,temp_lang_code));			-- Get Message From messages table
		SELECT @code AS code, @msg AS msg;

END//
