CREATE  PROCEDURE `xfusion_view_update_multiple`(
IN in_user_key VARCHAR(255),
IN in_user_id VARCHAR(255),
IN in_view_id text,
IN in_view_name text,
IN in_view_url text,
IN in_is_added text
)
    COMMENT 'Update Multiple Views'
BEGIN
/*
	-----------------------------------------------------------------------------------------------------------------------------------
	Description	:  This Procedure helps to update all the View.
	Created On	:	
	Created By	:	Abhishek Ginani
	-----------------------------------------------------------------------------------------------------------------------------------
	Inputs	:   in_user_key 		------------	(User's Key)								------------------------ VARCHAR (255),
				in_user_id  		------------	(User's ID)									------------------------ VARCHAR (255),
				in_view_id			------------	(View's ID to Update )						------------------------ INT
				in_view_name  		------------	(View's Name)								------------------------ VARCHAR (255),
				in_view_url  		------------	(View's URL)									------------------------ VARCHAR (255),
                in_is_added			------------	(is_added bit)								------------------------ VARCHAR (255)
	Output	:	
	------------------------------------------------------------------------------------------------------------------------------------
*/
	-- Variables
  DECLARE catchArbitrary int;
  DECLARE in_lang_code INT ;
  DECLARE temp_default_lang_code INT;
  DECLARE temp_lang_code INT ;
  SET in_lang_code=null;
  SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
  SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
  
    
    
    -- Temporary Tables
    call xfusion_string_split(in_view_id);
    drop temporary table if exists temp_view_id;
    create temporary table temp_view_id 
    select *,(@row_num:=@row_num+1) as id from temp_convert,(select @row_num:=0) as row_num_generator ;
    
	call xfusion_string_split(in_view_name);
	drop temporary table if exists temp_view_name;
    create temporary table temp_view_name 
    select *,(@row_num:=@row_num+1) as id from temp_convert,(select @row_num:=0)  as row_num_generator;
    
	call xfusion_string_split(in_view_url);
	drop temporary table if exists temp_view_url;
    create temporary table temp_view_url 
    select *,(@row_num:=@row_num+1) as id from temp_convert,(select @row_num:=0)  as row_num_generator;
    
	call xfusion_string_split(in_is_added);
	drop temporary table if exists temp_is_added;
    create temporary table temp_is_added 
    select *,(@row_num:=@row_num+1) as id from temp_convert,(select @row_num:=0)  as row_num_generator ;
    
    
    drop temporary table if exists temp_data_to_update;
    create temporary table temp_data_to_update 
    select  temp_view_id.split_data as view_id ,
			temp_view_name.split_data as view_name,
            temp_view_url.split_data as view_url,
            temp_is_added.split_data as is_added
    from temp_view_id 
    inner join temp_view_name on temp_view_id.id=temp_view_name.id
    inner join temp_view_url on temp_view_id.id=temp_view_url.id
    inner join temp_is_added on temp_view_id.id=temp_is_added.id;
    
   --  select * from temp_data_to_update;
    update ignore views
    inner join temp_data_to_update on views.view_id=temp_data_to_update.view_id
    set views.name= temp_data_to_update.view_name,
		 views.url=temp_data_to_update.view_url,
         views.lowered_url=lower(temp_data_to_update.view_url),
        views.is_added=temp_data_to_update.is_added;
	

	SET catchArbitrary=(SELECT xfusion_message_getsingle("isViewUpdated",TRUE,temp_lang_code));	
    
    -- Get Message From messages table
	SELECT @code AS code, @msg AS msg;

END//
DELIMITER ;

